import java.util.Scanner;class First {    public static void main(String args[]) {              int num;       String temp;         System.out.println("How many string you want to store in str-array");       Scanner getSCan = new Scanner(System.in);       num = getSCan.nextInt();       String str[] = new String[num];       Scanner getSCan2 = new Scanner(System.in);       for(int i = 0; i < str.length; i++){       	str[i] = getSCan2.nextLine();       }                 System.out.println("Before Sorting");         for(int i = 0; i < str.length; i++){       	System.out.println(str[i]);       }       System.out.println("After Sorting");       for(int i = 0; i < str.length; i++){       	for(int j = i+1; j < str.length; j++){       		if(str[i].compareTo(str[j]) > 0){       		       			temp = str[i];       			str[i] = str[j];       			str[j] = temp;        }       	}       }        for(int i = 0; i < str.length; i++){       	System.out.println(str[i]);       }    }}